      //     console.log("res: ", res);
      //     setList(res.data);
      //   })
      //   .catch((err) => {
      //     console.log("err: ", err);
      //   });
      const result = axios.get("https://jsonplaceholder.typicode.com/todos");

      setList(result.data);
    } catch (error) {
      console.log(`error: ${error}`);
    }
  };
  return (
    <div>
      <ul>
        {list.map((item) => (
          <li key={item.id}>
            <Link to={`${item.id}`}>{item.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
